import React from "react";

function Header() {
  return (
    <div className="header">
      <div className="header-left">
        <img src="/my-react-frontend/public/" />
      </div>
      <div className="header-center">mid</div>
      <div className="header-right">right</div>
    </div>
  );
}

export default Header;
